import React from 'react';

export const FilmList = ({ nameList }) => {
  const { results } = nameList;
  console.log(results);
  return (
    <div className="text-yellow-500 font-bold">
      {results[0].map(item => (
        <li>{item}</li>
      ))}
    </div>
  );
};
